    false,nt"url": null,nt"notes": "This interim plan for Big Oaks National
    Wildlife Refuge cover an interim comprehensive conservation plan, a hunting and
    fishing plan and an interim compatibility determination. Attachments are also included,
    which cover Big Oaks National Wildlife Refuge interim public access plan and an
    endangered species intra-service consultation. The Interim Comprehensive Conservation
    Plan is a general management guideline for the years that follow Refuge establishment.
    It covers establishing authorities and mission of Big Oaks National Wildlife Refuge,
    site information, habitat and wildlife management, law enforcement, refuge administration,
    public use opportunities and management, environmental education and refuge regulations,
    enforcement, hours and signs. The Interim Hunting and Fishing Plan covers conformance
    with statutory authorities, statement of goals, assessment, description of hunting
    and fishing program, measures taken to avoid conflicts with other management agencies,
    and conduct of the hunting and fishing program. The Interim Compatibility Determination
    covers refuge goals, availability of resources, anticipated impacts of the use,
    and  public comments. Attachments follow which include Interim Public Access Plan
    and Endangered Species Intra-Service Consultation.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
